import Products from "./components/Products";
import { StoreProvider } from "./store";




function App() {

  return 

   <StoreProvider>
    <BrowserRouter>
     <Routes>
      <Route path="/products" element={<Products/>}/> 
      <Route path="/cart" element={<Card/>}> 
    </Route>
    </Routes>
    </BrowserRouter>




   </StoreProvider>



}

export default App;
